import React from "react";
import "./Hamburger.scss";

function Hamburger() {
  return (
    <button
      className="hamburger hide-for-desktop"
      aria-expanded="false"
      onClick={(e) => e.target.classList.toggle("nav-open")}
    >
      <span></span>
      <span></span>
      <span></span>
    </button>
  );
}

export default Hamburger;
